import { BrowserRouter, Routes, Route } from "react-router-dom";
import { useState } from "react";
import Navbar from "./Navbar";
import Home from "./Home";
import Products from "./Products";
import Checkout from "./Checkout";
import Sidebar from "./components/Sidebar";
import CartDrawer from "./components/CartDrawer";
import SearchDrawer from "./components/SearchDrawer";

// Import the new pages
import Login from "./pages/Login";
import Register from "./pages/Register";
import Account from "./pages/Account";
import AdminDashboard from "./pages/AdminDashboard";

export default function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isCartOpen, setIsCartOpen] = useState(false);
  const [isSearchOpen, setIsSearchOpen] = useState(false);

  const closeAll = () => {
    setIsMenuOpen(false);
    setIsCartOpen(false);
    setIsSearchOpen(false);
  };

  return (
    <BrowserRouter>
      {/* DRAWERS */}
      <Sidebar isOpen={isMenuOpen} close={closeAll} />
      <CartDrawer isOpen={isCartOpen} close={closeAll} />
      <SearchDrawer isOpen={isSearchOpen} close={closeAll} />

      {/* OVERLAY */}
      <div
        className={`overlay ${isMenuOpen || isCartOpen || isSearchOpen ? "open" : ""}`}
        onClick={closeAll}
      />

      <Navbar
        onOpenMenu={() => setIsMenuOpen(true)}
        onOpenCart={() => setIsCartOpen(true)}
        onOpenSearch={() => setIsSearchOpen(true)}
      />

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/products/:category" element={<Products />} />
        <Route path="/checkout" element={<Checkout />} />

        {/* THESE ARE THE MISSING ROUTES CAUSING YOUR ERROR */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/account" element={<Account />} />
        <Route path="/admin" element={<AdminDashboard />} />
      </Routes>
    </BrowserRouter>
  );
}
